@kevinmurrayglass made this stunner for American Beauty, “Be Mine” inspired by Justin Helton’s art from a Valentines Day Grateful Dead concert poster in 1968! If you’d like to see the poster check out our pre-show teaser post from July 11 and swipe to the second pic.
Damn Kevin’s good! He’s really good; and because this piece is not faceted it comes to you at a great price 👌 Be sure to SWIPE 👉 Comes with matching BUBBLE CAP!
DM us or check it out on StokedCT.com #kevinmurrayglass #americanbeauty #stokedct
